DROP TABLE IF EXISTS `lab_submit`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lab_submit` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT COMMENT '自增ID',
  `lab_id` bigint unsigned NOT NULL DEFAULT '0' COMMENT '实验室id',
  `contest_id` bigint unsigned DEFAULT '0' COMMENT '竞赛id',
  `submit_data` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '提交内容',
  `submit_type` tinyint unsigned DEFAULT '0' COMMENT '提交类型',
  `submit_result` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '提交结果',
  `submit_time_usage` bigint NOT NULL DEFAULT '0' COMMENT '消耗时间',
  `status` tinyint NOT NULL DEFAULT '1' COMMENT '实验室状态',
  `creator_id` bigint unsigned DEFAULT '0',
  `creator` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT '' COMMENT '用户名',
  `create_time` bigint unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `update_time` bigint unsigned NOT NULL DEFAULT '0' COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `lab_id` (`lab_id`),
  KEY `status` (`status`),
  KEY `creator` (`creator`),
  KEY `create_time` (`create_time`),
  KEY `creator_id` (`creator_id`),
  KEY `contest_lab_id` (`contest_id`,`lab_id`)
) ENGINE=InnoDB AUTO_INCREMENT=509 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='提交表';
