INSERT INTO `lab_submit` VALUES (18,18,10,'<html>\n<body>\n<h1>我的第一个标题</h1>\n<p>我的第一个段落。</p>\n</body>\n</html>',0,'[{\"Id\":18,\"TestCaseId\":0,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:38)\"},{\"Id\":18,\"TestCaseId\":1,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":8,\"Err\":\"context deadline exceeded\"},{\"Id\":18,\"TestCaseId\":2,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":8,\"Err\":\"context deadline exceeded\"}]',0,8,0,'Chell01',1593168274267,1610546654751),(19,21,10,'<!DOCTYPE html>\n\n<!--\nCASE1 在最初的默认值，需要指定#input的textarea输入为1\\n2\\n3\\n4\\n5\\n，对应的#output的textarea输出值为输入的2倍，即2\\n4\\n6\\n8\\n10\nCASE2 要求#input和#output在同一行\nCASE3 接下来在点击#submit按钮之后，每隔300秒对动态变化的#input进行响应，计算方法为#input每行加1，并输出至#output的textarea中。例如测试2\\n4\\n5\\n6\\n8,输出值为3\\n5\\n6\\n7\\n9\n\nINPUT\n\nOUTPUT\n2\n3\n4\n8\n10\n12\n\nINPUT\ndocument.getElementById(\"input\").getElementsByTagName(\"textarea\")[0].innerHTML = \"2\\n4\\n5\\n6\\n8\"\nOUTPUT\n\"3\n5\n6\n7\n9\"\n\n-->\n\n\n\n<html lang=\"en\">\n<head>\n    <meta charset=\"UTF-8\">\n    <title>Title</title>\n</head>\n<style>\n    .inline {\n        display: inline-block;\n    }\n    #submit_div {\n        width: 100%;\n    }\n</style>\n<script>\n    function doSubmit() {\n        setInterval(changeOutput, 300)\n    }\n\n    function changeOutput() {\n        let input = document.getElementById(\"input\").getElementsByTagName(\"textarea\")[0].innerHTML\n        let inputs = input.split(\"\\n\")\n        let outputs = []\n        for (let i = 0; i < inputs.length; i++) {\n            if (inputs[i] == NaN) {\n                continue\n            }\n            outputs[i] = parseInt(inputs[i]) + 1\n        }\n        let output = outputs.join(\"\\n\")\n        document.getElementById(\"output\").getElementsByTagName(\"textarea\")[0].innerHTML = output\n    }\n</script>\n<body>\n        <div id=\"input\" class=\"inline\">\n<textarea cols=\"5\" rows=\"8\">\n1\n2\n3\n4\n5\n6</textarea>\n        </div>\n\n        <div id=\"output\" class=\"inline\">\n<textarea cols=\"5\" rows=\"8\" disabled=\"disabled\">\n2\n3\n4\n8\n10\n12</textarea>\n        </div>\n\n    <div id=\"submit_div\">\n        <button id=\"submit\" onclick=\"doSubmit()\">运行</button>\n    </div>\n\n</body>\n</html>',0,'[{\"Id\":19,\"TestCaseId\":0,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:21)\"},{\"Id\":19,\"TestCaseId\":1,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:32)\"},{\"Id\":19,\"TestCaseId\":2,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:33)\"},{\"Id\":19,\"TestCaseId\":3,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:67)\"},{\"Id\":19,\"TestCaseId\":4,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:67)\"},{\"Id\":19,\"TestCaseId\":5,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:67)\"}]',0,2,0,'Chell01',1593508029634,1610546654247),(20,18,10,'<html>\n<body>\n<h1>我的第一个标题</h1>\n<p>我的第一个段落。</p>\n</body>\n</html>',0,'[{\"Id\":20,\"TestCaseId\":0,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:38)\"},{\"Id\":20,\"TestCaseId\":1,\"TestCaseInput\":\"\",\"SubmitOutput\":\"\",\"TestcaseOutput\":\"\",\"Status\":2,\"Err\":\"encountered exception \'Uncaught\' (0:37)\"},{\"Id\":20,\"TestCaseId\":2,\"TestCaseInput\":\"\",\"SubmitOutput\":\"缺少段落字段\",\"TestcaseOutput\":\"\",\"Status\":7,\"Err\":\"\"}]',0,7,10000,'测试用户',161